Seabiscuit: An American Legend is a non-fiction book written by Laura Hillenbrand published in 2001 about the thoroughbred race horse, Seabiscuit. It won the William Hill Sports Book of the Year and was adapted as a feature film in 2003. It has also been published under the title: Seabiscuit - The True Story Of 3 Men &amp; a Race Horse. The author has been praised for her ability to convey a sense of historical times.
